import React, { useState } from 'react';
import { useCrawler } from '../../Hooks/useCrawler';
import URLInput from '../../Components/Analyzer/URLInput/URLInput';
import CrawlProgress from '../../Components/Analyzer/CrawlProgress/CrawlProgress';
// Assuming you have a ResultsDisplay component for showing the analysis results
import ResultsDisplay from '../../Components/Analyzer/ResultsDisplay/ResultsDisplay'; 

const Analyze = () => {
  const { loading, error, results, progress, analyzeURL, reset } = useCrawler();

  const handleAnalyze = async (url, options) => {
    await analyzeURL(url, options);
  };

  const handleNewAnalysis = () => {
    reset();
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-50 to-purple-100 py-16">
      <div className="max-w-5xl mx-auto px-4 sm:px-6 lg:px-8">
        {/* Header */}
        <div className="text-center mb-16">
          <h1 className="text-5xl font-extrabold text-gray-900 mb-6 leading-tight">
            <span className="bg-clip-text text-transparent bg-gradient-to-r from-indigo-600 to-purple-600">
              JavaScript SEO Analyzer
            </span>
          </h1>
          <p className="text-xl text-gray-700 max-w-3xl mx-auto font-light">
            Uncover how search engines truly see your JavaScript-powered website. 
            Get detailed insights and actionable recommendations in 
            <span className="font-semibold text-indigo-700"> under 30 seconds</span>.
          </p>
        </div>

        {/* Main Analyzer Card */}
        <div className="bg-white shadow-xl rounded-2xl p-10 mb-12 border border-gray-100">
          {!results && !error && (
            <div className="space-y-10">
              <URLInput onAnalyze={handleAnalyze} loading={loading} />

              {loading && (
                <CrawlProgress progress={progress} currentStep={getCurrentStep(progress)} />
              )}
            </div>
          )}

          {error && (
            <div className="bg-red-50 border border-red-300 rounded-lg p-8 text-center animate-fade-in">
              <div className="text-red-700 text-3xl mb-4">
                <span role="img" aria-label="alert">‚ö†Ô∏è</span>
              </div>
              <div className="text-red-800 text-xl font-bold mb-3">Analysis Failed</div>
              <p className="text-red-700 mb-6 leading-relaxed">{error}</p>
              <button
                onClick={handleNewAnalysis}
                className="px-8 py-3 bg-red-600 text-white font-semibold rounded-full shadow-md 
                           hover:bg-red-700 focus:outline-none focus:ring-2 focus:ring-red-500 focus:ring-opacity-75 
                           transition-all duration-300 ease-in-out"
              >
                Try Another Analysis
              </button>
            </div>
          )}

          {results && (
            <div className="animate-fade-in">
              <div className="flex justify-between items-center mb-8 pb-4 border-b border-gray-200">
                <h2 className="text-3xl font-bold text-gray-900">Analysis Complete!</h2>
                <button
                  onClick={handleNewAnalysis}
                  className="px-6 py-2 border border-indigo-300 text-indigo-700 font-semibold rounded-full 
                             hover:bg-indigo-50 transition-colors duration-200 ease-in-out"
                >
                 <span className="mr-2">‚ú®</span> New Analysis
                </button>
              </div>
              {/* This is a placeholder for where your results would be displayed */}
              <ResultsDisplay results={results} /> 
              {/* You'd replace <ResultsDisplay> with your actual results component */}
            </div>
          )}
        </div>

        {/* Trust Indicators */}
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 text-center">
          <div className="bg-white rounded-xl p-8 shadow-md border border-gray-100 transform hover:scale-105 transition-transform duration-300">
            <div className="text-5xl mb-4">üîí</div>
            <div className="font-bold text-gray-900 text-xl mb-2">Secure & Private</div>
            <div className="text-gray-600 text-md">Your data is never stored or shared.</div>
          </div>
          <div className="bg-white rounded-xl p-8 shadow-md border border-gray-100 transform hover:scale-105 transition-transform duration-300">
            <div className="text-5xl mb-4">‚ö°</div>
            <div className="font-bold text-gray-900 text-xl mb-2">Blazing Fast</div>
            <div className="text-gray-600 text-md">Analysis completed in under 30 seconds.</div>
          </div>
          <div className="bg-white rounded-xl p-8 shadow-md border border-gray-100 transform hover:scale-105 transition-transform duration-300">
            <div className="text-5xl mb-4">üí°</div>
            <div className="font-bold text-gray-900 text-xl mb-2">Actionable Insights</div>
            <div className="text-gray-600 text-md">Clear, prioritized recommendations for improvement.</div>
          </div>
        </div>
      </div>
    </div>
  );
};

function getCurrentStep(progress) {
  if (progress < 25) return 'Initializing secure browser environment...';
  if (progress < 50) return 'Loading and rendering page content...';
  if (progress < 75) return 'Executing all dynamic JavaScript...';
  return 'Analyzing SEO factors and generating report...';
}

export default Analyze;
